import{_ as t,o as a,c as n,z as e,a as s}from"./chunks/framework.9482e208.js";const k=JSON.parse('{"title":"§ 46.2-749.73 Special license plates; supporters of the Washington Redskins football team; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-749.73.md","filePath":"vacode/46.2-749.73.md"}'),o={name:"vacode/46.2-749.73.md"},i=e("h1",{id:"§-46-2-749-73-special-license-plates-supporters-of-the-washington-redskins-football-team-fees",tabindex:"-1"},[s("§ 46.2-749.73 Special license plates; supporters of the Washington Redskins football team; fees. "),e("a",{class:"header-anchor",href:"#§-46-2-749-73-special-license-plates-supporters-of-the-washington-redskins-football-team-fees","aria-label":'Permalink to "§ 46.2-749.73 Special license plates; supporters of the Washington Redskins football team; fees."'},"​")],-1),l=e("p",null,"A. On receipt of an application and payment of the fee prescribed by this section, the Commissioner shall issue special license plates to supporters of the Washington Redskins football team.",-1),r=e("p",null,"B. The annual fee for plates issued pursuant to this section shall be twenty-five dollars in addition to the prescribed fee for state license plates. For each such twenty-five-dollar fee collected in excess of 1,000 registrations pursuant to this section, fifteen dollars shall be paid into the state treasury and credited to a special nonreverting fund known as the Washington Redskins Leadership Council Fund established within the Department of Accounts. These funds shall be paid annually to the Washington Redskins Leadership Council for its use in community programs in Virginia.",-1),c=e("p",null,[s("2002, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0864",target:"_blank",rel:"noreferrer"},"864"),s(".")],-1),p=[i,l,r,c];function d(h,f,u,_,m,g){return a(),n("div",null,p)}const v=t(o,[["render",d]]);export{k as __pageData,v as default};
